const ProductSpan = (props)=>{

  return (<span className='product-span'>
    <span className='product-id'>Id:{props.id}</span>
    <span className='product-name'>Name:{props.name}</span>
    <span className='product-price'>Price:{props.price}</span>
    </span>)
}

export default ProductSpan;
